import React from 'react';

import TextField from '@material-ui/core/TextField';

export const Form = () => {

  return (
    <form className="form" noValidate autoComplete="off">
      <TextField
        error
        label="Email"
        variant="outlined"
        helperText="Empty field"
      />
      <TextField
        label="Password"
        variant="outlined"
      />
    </form>
  );
};
